er is a city in the Canadian province of Ontario, about 100 km (62 mi) west of Toronto.","country_id":"7","state_id":"39","created_at":"2023-01-31 12:58:32","updated_at":"2023-01-31 12:58:32"},{"id":"178","name":"Regina","image":"63d91196da26c.jpg","description":"Official City of Regina website with the latest information on City programs, ... Regina is a vibrant city located in the province of Saskatchewan, Canada.","country_id":"7","state_id":"42","created_at":"2023-01-31 13:03:18","updated_at":"2023-01-31 13:03:18"},{"id":"179","name":"Chengdu","image":"63d915a688a7f.jpg","description":"Chengdu alternatively romanized as Chengtu, is a sub-provincial city which serves as the capital of the Chinese province of Sichuan.","country_id":"8","state_id":"64","created_at":"2023-01-31 13:20:38","updated_at":"2023-01-31 13:20:38"},{"id":"180","name":"Chongqing","image":"63d91608bc538.jpg","description":"Chongqing is the only city in China with a permanent population of over 30 million. ... Chongqing is the fourth largest Chinese city by urban population","country_id":"8","state_id":"64","created_at":"2023-01-31 13:22:16","updated_at":"2023-01-31 13:22:16"},{"id":"181","name":"Tianjin ","image":"63d91674b0762.jpg","description":"Tianjin (天津; Tiānjīn) is a major city in North China that neighbours the capital city of Beijing. In 2020, it was home to almost 14 million people.","country_id":"8","state_id":"51","created_at":"2023-01-31 13:24:04","updated_at":"2023-01-31 13:24:04"},{"id":"182","name":"Beijing ","image":"63d916d8c883f.jpg","description":"Beijing is a global city and one of the world's leading centres for culture, diplomacy, politics, finance, business and economics, education, research, language","country_id":"8","state_id":"51","created_at":"2023-01-31 13:25:44","updated_at":"2023-01-31 13:25:44"},{"id":"183","name":"Nanjing","image":"63d917be3e5c5.jpg","description":"Nanjing, capital of China’s eastern Jiangsu province, is roughly 300km up the Yangtze River from the city of Shanghai. It was the national capital during part of the Ming dynasty. Many monuments and landmarks remain, including Zhonghua Gate (Gate of China),","country_id":"8","state_id":"56","created_at":"2023-01-31 13:29:34","updated_at":"2023-01-31 13:29:34"},{"id":"184","name":"Wuhan ","image":"63d91845089cd.jpg","description":"Wuhan is the capital of Hubei Province in the People's Republic of China. It is the largest city in Hubei and the most populous city in Central China,","country_id":"8","state_id":"54","created_at":"2023-01-31 13:31:49","updated_at":"2023-01-31 13:31:49"},{"id":"185","name":"Harbin","image":"63d9194b8dbdb.jpg","description":"Harbin is the capital of Heilongjiang, China’s northernmost province. The city grew in the late 19th century with the influx of Russian engineers constructing the eastern leg of the Trans-Siberian Railroad. The city's Russian architecture includes its green-domed Saint Sophia Cathedral, an Eastern Orthodox church now a local history museum. Across the river, Sun Island Park is famed for year-round ice sculptures","country_id":"8","state_id":"52","created_at":"2023-01-31 13:36:11","updated_at":"2023-01-31 13:36:11"},{"id":"186","name":"Suzhou","image":"63d919a79650b.jpg","description":"Suzhou alternately romanized as Soochow, is a major city in southern Jiangsu province, East China. Suzhou is the most populous city in Jiangsu","country_id":"8","state_id":"56","created_at":"2023-01-31 13:37:43","updated_at":"2023-01-31 13:37:43"},{"id":"187","name":"Ningbo","image":"63d91a5e5f7f9.jpg","description":"Ningbo formerly romanized as Ningpo, is a major sub-provincial city in northeast Zhejiang province, People's Republic of China.","country_id":"8","state_id":"66","created_at":"2023-01-31 13:40:46","updated_at":"2023-01-31 13:40:46"},{"id":"188","name":"Wenzhou ","image":"63d91aaad3849.jpg","description":"Wenzhou historically known as Wenchow is a prefecture-level city in southeastern Zhejiang province in the People's Republic of China. Wenzhou is located","country_id":"8","state_id":"66","created_at":"2023-01-31 13:42:02","updated_at":"2023-01-31 13:42:02"},{"id":"189","name":"Nice","image":"63d91d477d7cc.jpg","description":"Located on the French Riviera, the southeastern coast of France on the Mediterranean Sea, at the foot of the French Alps, Nice is the second-largest French city ","country_id":"9","state_id":"67","created_at":"2023-01-31 13:53:11","updated_at":"2023-01-31 13:53:11"},{"id":"190","name":"Tours","image":"63d91e62ea05b.jpg","description":"Tours is a university town between France's Cher and Loire rivers. Once a Gallic-Roman settlement, today it's a university town and a traditional gateway for exploring the chateaux of the Loire Valley region. Major landmarks include the cathedral, Saint-Gatien, whose flamboyant Gothic facade is flanked by towers with 12th-century bases and Renaissance tops","country_id":"9","state_id":"70","created_at":"2023-01-31 13:57:54","updated_at":"2023-01-31 13:57:54"}]

